INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(101, 'The Greatest Showman', 'Celebrates the birth of show business and tells of a visionary who rose from nothing to create a spectacle that became a worldwide sensation. \r\nOrphaned, penniless, but ambitious and with a mind crammed with imagination and fresh ideas, the American entertainer, Phineas Taylor Barnum, will always be remembered as the man with the gift to blur the line between reality and fiction. Thirsty for innovation and hungry for success, the son of a tailor manages to open a wax museum; however, he soon shifts focus to the unique and the peculiar, introducing extraordinary, never-seen-before live acts on the circus stage. Now, some people call Barnum\'s rich collection of oddities, an outright freak show; but, when Phineas, obsessed for cheers and respectability, gambles everything on the opera singer, Jenny Lind, to appeal to a high-brow audience, he will lose sight of the most crucial aspect of his life: his family. Will Barnum, the greatest showman, risk it all to be accepted?', '2017', , '1h 45m', 'https://www.youtube.com/embed/AXCTMGYUg9A?si=5fefDuWiBUvAfGxC');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(102, 'The Dark Knight', 'When the menace known as the Joker wreaks havoc and chaos on the people of Gotham, Batman must accept one of the greatest psychological and physical tests of his ability to fight injustice.\r\nSet within a year after the events of Batman Begins (2005), Batman, Lieutenant James Gordon, and new District Attorney Harvey Dent successfully begin to round up the criminals that plague Gotham City, until a mysterious and sadistic criminal mastermind known only as \"The Joker\" appears in Gotham, creating a new wave of chaos. Batman\'s struggle against The Joker becomes deeply personal, forcing him to \"confront everything he believes\" and improve his technology to stop him. A love triangle develops between Bruce Wayne, Dent, and Rachel Dawes.', '2008', , '2h 32m', 'https://youtu.be/EXeTwQWrcwY?si=R99lZeU7v1mRfggy');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(103, 'Parasite', 'Greed and class discrimination threaten the newly-formed symbiotic relationship between the wealthy Park family and the destitute Kim clan.\r\nThe Kims - mother and father Chung-sook and Ki-taek, and their young adult offspring, son Ki-woo and daughter Ki-jung - are a poor family living in a shabby and cramped half basement apartment in a busy lower working class commercial district of Seoul. Ki-woo is the one who has dreams of getting out of poverty by one day going to university. Despite not having that university education, Ki-woo is chosen by his university student friend Min, who is leaving to go to school, to take over his tutoring job to Park Da-hye, who Min plans to date once he returns to Seoul and she herself is in university. The Parks are a wealthy family who for four years have lived in their modernistic house designed by and the former residence of famed architect Namgoong. While Mr. and Mrs. Park are all about status, Mrs. Park has a flighty, simpleminded mentality and temperament, which Min tells Ki-woo to feel comfortable in lying to her about his education to get the job. In getting the job, Ki-woo further learns that Mrs. Park is looking for an art therapist for the Parks\' adolescent son, Da-song, Ki-woo quickly recommending his professional art therapist friend \"Jessica\", really Ki-jung who he knows can pull off the scam in being the easiest liar of the four Kims. In Ki-woo also falling for Da-hye, he begins to envision himself in that house, and thus the Kims as a collective start a plan for all the Kims, like Ki-jung using assumed names, to replace existing servants in the Parks\' employ in orchestrating reasons for them to be fired. The most difficult to get rid of may be Moon-gwang, the Parks\' housekeeper who literally came with the house - she Namgoong\'s housekeeper when he lived there - and thus knows all the little nooks and crannies of it better than the Parks themselves. The question then becomes how far the Kims can take this scam in their quest to become their version of the Parks.', '2019', , '2h 12m', 'https://youtu.be/SEUXfv87Wpk?si=ndCwrqx2FrCnsYX5');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(104, 'Avengers: Endgame', 'After the devastating events of Avengers: Infinity War (2018), the universe is in ruins. With the help of remaining allies, the Avengers assemble once more in order to reverse Thanos\' actions and restore balance to the universe.', '2019', , '3h 1m', 'https://youtu.be/TcMBFSGVi1c?si=-1W817plfPkym3hW');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(105, 'The Silence of the Lambs', 'A young F.B.I. cadet must receive the help of an incarcerated and manipulative cannibal killer to help catch another serial killer, a madman who skins his victims.', '1991', , '1h 58m', 'https://youtu.be/6iB21hsprAQ?si=xHZ42t-eRS6knw_s');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(106, 'Spirited Away', 'During her family\'s move to the suburbs, a sullen 10-year-old girl wanders into a world ruled by gods, witches and spirits, and where humans are changed into beasts.\r\nThe fanciful adventures of a ten-year-old girl named Chihiro, who discovers a secret world when she and her family get lost and venture through a hillside tunnel. When her parents undergo a mysterious transformation, Chihiro must fend for herself as she encounters strange spirits, assorted creatures and a grumpy sorceress who seeks to prevent her from returning to the human world.', '2001', , '2h 5m', 'https://youtu.be/ByXuk9QqQkk?si=6-5BLdjD9orOMlsF');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(107, 'La La Land', 'While navigating their careers in Los Angeles, a pianist and an actress fall in love while attempting to reconcile their aspirations for the future.\r\nAspiring actress serves lattes to movie stars in between auditions and jazz musician Sebastian scrapes by playing cocktail-party gigs in dingy bars. But as success mounts, they are faced with decisions that fray the fragile fabric of their love affair, and the dreams they worked so hard to maintain in each other threaten to rip them apart.', '2016', , '2h 8m', 'https://youtu.be/je0aAf2f8XQ?si=CFPMP4EIw49PGebl');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(108, 'Up', '78-year-old Carl Fredricksen travels to Paradise Falls in his house equipped with balloons, inadvertently taking a young stowaway.\r\nAs a boy, Carl Fredricksen wanted to explore South America and find the forbidden Paradise Falls. About 64 years later he gets to begin his journey along with Boy Scout Russell by lifting his house with thousands of balloons. On their journey, they make many new friends including a talking dog, and figure out that someone has evil plans. Carl soon realizes that this evildoer is his childhood idol.', '2009', , '1h 36m', 'https://youtu.be/HWEW_qTLSEE?si=DYxnUmiXAJ_nv1D5');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(109, 'Toy Story', 'A cowboy doll is profoundly threatened and jealous when a new spaceman action figure supplants him as top toy in a boy\'s bedroom.\r\nA little boy named Andy loves to be in his room, playing with his toys, especially his doll named \"Woody\". But, what do the toys do when Andy is not with them, they come to life. Woody believes that his life (as a toy) is good. However, he must worry about Andy\'s family moving, and what Woody does not know is about Andy\'s birthday party. Woody does not realize that Andy\'s mother gave him an action figure known as Buzz Lightyear, who does not believe that he is a toy, and quickly becomes Andy\'s new favorite toy. Woody, who is now consumed with jealousy, tries to get rid of Buzz. Then, both Woody and Buzz are now lost. They must find a way to get back to Andy before he moves without them, but they will have to pass through a ruthless toy killer, Sid Phillips.', '1995', , '1h 21m', 'https://youtu.be/v-PjgYDrg70?si=LTYvVAf-XX6MXnNM');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(110, 'Joker', 'During the 1980s, a failed stand-up comedian is driven insane and turns to a life of crime and chaos in Gotham City while becoming an infamous psychopathic crime figure.\r\nA socially inept clown for hire - Arthur Fleck aspires to be a stand up comedian among his small job working dressed as a clown holding a sign for advertising. He takes care of his mother, Penny Fleck, and as he learns more about his mental illness, he learns more about his past. Dealing with all the negativity and bullying from society, he heads downwards on a spiral, in turn showing how his alter ego, \"Joker,\" came to be.', '2019', , '2h 2m', 'https://youtu.be/zAGVQLHvwOY?si=m_j6YEIdytq_SeR1');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(111, '3 Idiots', 'Two friends are searching for their long lost companion. They revisit their college days and recall the memories of their friend who inspired them to think differently, even as the rest of the world called them \"idiots\".\r\nRancho is an engineering student. His two friends. Farhan and Raju, Rancho sees the world in a different way. Rancho goes somewhere one day. And his friends find him. When Rancho is found, he has become one of a great scientist in the world.', '2009', , '2h 50m', 'https://youtu.be/K0eDlFX9GMc?si=W0wAK6wbx_XyGNUQ');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(112, 'The Sound of Music', 'A young novice is sent by her convent in 1930s Austria to become a governess to the seven children of a widowed naval officer.\r\nIn 1930s Austria, a young woman named Maria is failing miserably in her attempts to become a nun. When Navy Captain Georg Von Trapp writes to the abbey asking for a governess that can handle his seven mischievous children, Maria is given the job. His wife is dead, he is often away, and he runs the household as strictly as he does the ships he sails on. The children are unhappy and resentful of the governesses that he keeps hiring and have managed to run each of them off one by one. When Maria arrives, she is initially met with the same hostility, but her kindness, understanding, and sense of fun soon draws the children to her and brings some much-needed joy into all their lives, including the Captain\'s. Eventually he and Maria find themselves falling in love, even though he is already engaged to a Baroness named Elsa and Maria is still a postulant. The romance makes them both start questioning the decisions they have made. Their personal conflicts soon become overshadowed, however, by world events. Austria is about to come under Germany\'s control, and the Captain may soon find himself drafted into the German Navy and forced to fight against his own country.', '1965', , '2h 52m', 'https://youtu.be/bZNcqtx83Io?si=C-DDMiCCfBlwOrOO');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(113, 'Love Actually', 'Follows the lives of eight very different couples in dealing with their love lives in various loosely interrelated tales all set during a frantic month before Christmas in London, England.', '2003', , '2h 15m', 'https://youtu.be/H9Z3_ifFheQ?si=4csVIrM-yjiiy3vT');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(114, 'The Parent Trap', 'Identical twins Annie and Hallie, separated at birth and each raised by one of their biological parents, discover each other for the first time at summer camp and make a plan to bring their wayward parents back together.\r\nWhen two pre-teens named Hallie and Annie meet at summer camp, their lives are rattled when they realize that they are identical twins. With parents, British mother aka famous dress designer Elizabeth and American father, a wine maker named Nick, living on different sides of the universe, the girls decide to make an identity swap in hopes of spending time with their other parent. The girls later choose to inform their guardians of the swap while at a hotel in San Francisco, which later reunites the divorced pair and they remarry.', '1998', , '2h 8m', 'https://youtu.be/PMAhVpgzmRU?si=bV2B46r3IxZ-QsKa');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(115, 'Inside Out', 'After young Riley is uprooted from her Midwest life and moved to San Francisco, her emotions - Joy, Fear, Anger, Disgust and Sadness - conflict on how best to navigate a new city, house, and school.\r\nGrowing up can be a bumpy road, and it\'s no exception for Riley, who is uprooted from her Midwest life when her father starts a new job in San Francisco. Like all of us, Riley is guided by her emotions - Joy, Fear, Anger, Disgust and Sadness. The emotions live in Headquarters, the control center inside Riley\'s mind, where they help advise her through everyday life. As Riley and her emotions struggle to adjust to a new life in San Francisco, turmoil ensues in Headquarters. Although Joy, Riley\'s main and most important emotion, tries to keep things positive, the emotions conflict on how best to navigate a new city, house and school.', '2015', , '1h 35m', 'https://youtu.be/yRUAzGQ3nSY?si=XvFek_jQGcawr1qj');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(116, 'The pursuit of Happyness', 'A struggling salesman takes custody of his son as he\'s poised to begin a life-changing professional career.\r\nBased on a true story about a man named Christopher Gardner. Gardner has invested heavily in a device known as a \"bone density scanner\". He feels like he has it made selling these devices. However, they do not sell well as they are marginally better than x-ray at a much higher price. As Gardner works to make ends meet, his wife leaves him and he loses his apartment. Forced to live out in the streets with his son, Gardner continues to sell bone density scanners while concurrently taking on an unpaid internship as a stockbroker, with slim chances for advancement to a paid position. Before he can receive pay, he needs to outshine the competition through 6 months of training, and to sell his devices to stay afloat.', '2006', , '1h 57m', 'https://youtu.be/DMOBlEcRuw8?si=wP48hr-RdY8HBRQc');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(117, 'Exhuma', 'The process of excavating an ominous grave unleashes dreadful consequences buried underneath.\r\nA wealthy family in Los Angeles experiences a series of bizarre supernatural events. The family contacts famous young shamans Hwa-Rim and Bong-Gil. After investigating, Hwa-Rim realizes that these events are related to the family\'s ancestor. Hwa-Rim asks Feng Shui export Sang-Deok and undertaker Young-Geun for help. They find the family’s ancestor\'s grave in a remote South Korean village and dig up the grave.', '2024', , '2h 14m', 'https://youtu.be/fRkOWmfZjkY?si=O5FA-GkrCHitdkDO');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(118, 'The Maze Runner', 'Thomas is deposited in a community of boys after his memory is erased, soon learning they\'re all trapped in a maze that will require him to join forces with fellow \"runners\" for a shot at escape.\r\nAwakening in an elevator, remembering nothing of his past, Thomas emerges into a world of about thirty teenage boys, all without past memories, who have learned to survive under their own set of rules in a completely enclosed environment, subsisting on their own agriculture and supplies. With a new boy arriving every thirty days, the group has been in \"The Glade\" for three years, trying to find a way to escape through the Maze that surrounds their living space (patrolled by cyborg monsters named \'Grievers\'). They have begun to give up hope when a comatose girl arrives with a strange note, and their world begins to change with the boys dividing into two factions: those willing to risk their lives to escape and those wanting to hang onto what they\'ve got and survive.', '2014', , '1h 53m', 'https://youtu.be/AwwbhhjQ9Xk?si=6QMR1RUfcv2tg2iZ');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(119, 'Begin Again', 'A chance encounter between a down-and-out music business executive, and a young singer songwriter new to Manhattan, turns into a promising collaboration between the two talents.\r\nGretta (Keira Knightley) and her long-time boyfriend Dave (Adam Levine) are college sweethearts and songwriting partners who decamp for New York when he lands a deal with a major label. But the trappings of his new-found fame soon tempt Dave to stray, and a reeling, lovelorn Gretta is left on her own. Her world takes a turn for the better when Dan (Mark Ruffalo), a disgraced record-label exec, stumbles upon her performing on an East Village stage and is immediately captivated by her raw talent. From this chance encounter emerges an enchanting portrait of a mutually transformative collaboration, set to the soundtrack of a summer in New York City.', '2013', , '1h 44m', 'https://youtu.be/uTRCxOE7Xzc?si=FjJX-a6Tifq1p4Hf');
INSERT INTO `Movie` (`movie_id`, `title`, `overview`, `release_date`, `movie_image`, `runtime`, `trailer`) VALUES
(120, 'Black Panther', 'T\'Challa, heir to the hidden but advanced kingdom of Wakanda, must step forward to lead his people into a new future and must confront a challenger from his country\'s past.\r\nAfter the events of Captain America: Civil War, Prince T\'Challa returns home to the reclusive, technologically advanced African nation of Wakanda to serve as his country\'s new king. However, T\'Challa soon finds that he is challenged for the throne from factions within his own country. When two foes conspire to destroy Wakanda, the hero known as Black Panther must team up with C.I.A. agent Everett K. Ross and members of the Dora Milaje, Wakandan special forces, to prevent Wakanda from being dragged into a world war.', '2018', , '2h 14m', 'https://youtu.be/xjDjIWPwcPU?si=Ofw6LEz-hyiZRrag');

